import{_ as t,c as a,m as r,o as s}from"./chunks/framework.CcfPirFf.js";const n="/assets/chengdu-kaiyuanshe-01.D_gtc2JY.jpg",o="/assets/chengdu-kaiyuanshe-02.TIbUct4S.jpg",p="/assets/chengdu-kaiyuanshe-03.D9ILJX09.jpg",i="/assets/chengdu-kaiyuanshe-04.Buo76V4B.jpg",h="/assets/chengdu-kaiyuanshe-05.DdgzhQlp.jpg",g="/assets/chengdu-egg.BDf4-r8r.jpg",k=JSON.parse('{"title":"飞桨社区成都行：开源社活动与开发者线下 Meetup","description":"","frontmatter":{"title":"飞桨社区成都行：开源社活动与开发者线下 Meetup","date":"2023-11-02T00:00:00.000Z","author":{"name":"孙师傅","github":"sunzhongkai588"},"category":"community-activity"},"headers":[],"relativePath":"posts/chengdu-kaiyuanshe.md","filePath":"posts/chengdu-kaiyuanshe.md"}'),u={name:"posts/chengdu-kaiyuanshe.md"};function c(l,e,d,m,_,f){return s(),a("div",null,[...e[0]||(e[0]=[r('<p>2023 年 10 月 28 日、29 日参加开源社举办的「第八届中国开源年会」的精彩瞬间，以及与咱 Paddle 社区成都开发者们的线下见面～</p><h2 id="第八届中国开源年会" tabindex="-1">第八届中国开源年会 <a class="header-anchor" href="#第八届中国开源年会" aria-label="Permalink to &quot;第八届中国开源年会&quot;">​</a></h2><p>飞桨开源社区受邀参加第八届中国开源年会，梦师傅和我（孙师傅）都贡献了两场精彩的演讲 🎉。</p><p>28 日的活动中，梦师傅在<strong>青少年开源与开源教育</strong>分论坛上，分享了主题为「<strong>走进开源社区</strong>」的演讲，向祖国的仙人掌们 🌵 宣传咱们充满趣味和活力的飞桨开源社区。</p><p><img src="'+n+'" alt="图片1"></p><p><img src="'+o+'" alt="图片2"></p><p>梦师傅还鼓励了很多青年开发者加入飞桨开源社区，其中甚至有一名刚年满 15 岁的初中学生，在活动后提交了 PR 并成功合入，成为了 Paddle 的 contributor <a href="https://github.com/BernieHuang2008" target="_blank" rel="noreferrer">@BernieHuang2008</a>。</p><p>29 日的主论坛上，孙师傅进行了<strong>闪电演讲</strong>，分享了「<strong>如何在开源社区摸 🐟</strong>」，介绍了孙师傅工作 0.5kun 年🐔 里总结的摸鱼心得。</p><p><img src="'+p+'" alt="图片3"></p><p>演讲的详细内容将在后续的博客中分享，敬请期待～</p><h2 id="飞桨社区成都开发者-meetup" tabindex="-1">飞桨社区成都开发者 Meetup <a class="header-anchor" href="#飞桨社区成都开发者-meetup" aria-label="Permalink to &quot;飞桨社区成都开发者 Meetup&quot;">​</a></h2><p>在 29 日，我们还相约飞桨社区成都的开发者们线下面基，以下是痛失真名的成都开发者（<s>网友</s>）：</p><ul><li>卢畅（左一） <a href="https://github.com/AndSonder" target="_blank" rel="noreferrer">@AndSonder</a>；陈思州（左二） <a href="https://github.com/jjyaoao" target="_blank" rel="noreferrer">@jjyaoao</a>；王龙志（左四） <a href="https://github.com/Wanglongzhi2001" target="_blank" rel="noreferrer">@Wanglongzhi2001</a>；谢浚霖（左五）<a href="https://github.com/PommesPeter" target="_blank" rel="noreferrer">@PommesPeter</a></li></ul><p><img src="'+i+'" alt="图片4"></p><p>梦师傅还很贴心的给每位开发者赠送了 PaddlePaddle contributor 专属徽章 🥳。</p><p><img src="'+h+'" alt="图片5"></p><p>期待未来与成都的伙伴们再次见面！</p><h2 id="彩蛋-🎊" tabindex="-1">彩蛋 🎊 <a class="header-anchor" href="#彩蛋-🎊" aria-label="Permalink to &quot;彩蛋 🎊&quot;">​</a></h2><p>最后，我们还一起跟随军哥 <a href="https://github.com/jzhang533" target="_blank" rel="noreferrer">@jzhang533</a> 观看了一场外国小姐姐的 livehouse，很精彩哟！</p><p><img src="'+g+'" alt="图片6"></p>',20)])])}const P=t(u,[["render",c]]);export{k as __pageData,P as default};
